import React from 'react';
import {Box} from "./Box"

export const Detail=({match})=>{
    console.log(match.params)
    return(
        <React.Fragment>
           {this.props.temaKorok.map((obj)=><Box key={obj.id} job={obj}/>)  }     
             {/*<Box key={props} word={props.adatok.kod} />*/}
        </React.Fragment>
        
    )
}
